import { render } from '@testing-library/react';
import React, { useState } from 'react';
import { Component } from 'react/cjs/react.production.min';
import './App.css';

let currentTitle = `The Movie List`;
let popular = false;

const title = <h1 className="App-title">{currentTitle}</h1>;

const categories = <ol className="Categorie-list"><li className="Categorie-list"><button onClick={ActivatePopular}>Popular</button></li><li className="Categorie-list">New Movies</li><li className="Categorie-list">Movies</li></ol>

function ActivatePopular(){

  console.log("activated")
  popular = true;

  console.log(popular)

  App();
}

function App() {
{
  class Application extends React.Component {
    popular = this.state.popular;
  }

    console.log(popular)

    if (popular)
    {
      console.log("true")
      return (
        <div className="App">
          <header className="App-header">

          </header>
          <body className="App-body">

            <div className="Movie-list">

            </div>

          </body>
        </div>
      );
    }
    else if (!popular)
    {
      console.log("false")
      return (
        <div className="App">
          <header className="App-header">
            {title}
            <a
              className="App-link"
              href="https://themoviedb.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              List API
            </a>

            {categories}

          </header>
          <body className="App-body">

            <div className="Movie-list">

            </div>

          </body>
        </div>
      );
    }
  }
  ReactDOM.render(
    <App />
  )

}

export default App;
